import React from "react";
import Draggable from "react-draggable";
import { styled } from "styled-components";

export default function DraggableTable(props){

    const TableImg = styled.img` 
        width: 60%;
        height: 60%;
    `

    const DraggableIcon = styled.img`
        position: absolute;
        top: 0.5rem;
        right: 0.5rem;
    `

    return(
        <Draggable>
            <DraggableIcon className="draggable-icon" src={`/assets/icons/${props.img}`}/>
            <TableImg src="/assets/icons/tables/round-table.svg"/>
        </Draggable>
    )
}
